// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.9.0;

contract Doctor {
  uint public doctor_count = 0;
  string public name = "Doctor";
  mapping(uint => Data) public datas;
  uint lastUpdated;
  

  struct Data {
    uint id;
    string patient_hash;
    string doctor_name;
    string patient_name;
    string patient_gender;
    string prescription;
    address author;
    uint lastUpdated;
  }

  event VideoUploaded(
    uint id,
    string patient_hash,
    string doctor_name,
    string patient_name,
    string patient_gender,
    string prescription,
    address author,
    uint lastUpdated
  );

  constructor() public {
  }
  function updateTimestamp() public {
  lastUpdated = block.timestamp;
}

  function uploadVideo(string memory _patient_hash, string memory _doctor_name, string memory _patient_name, string memory _patient_gender, string memory _prescription) public {
    // Make sure the video hash exists
    require(bytes(_patient_hash).length > 0);
    // Make sure video title exists
  
    require(msg.sender!=address(0));
    
    // Increment video id
    doctor_count ++;
    updateTimestamp();
    // Add video to the contract
    datas[doctor_count] = Data(doctor_count, _patient_hash, _doctor_name, _patient_name, _patient_gender, _prescription, msg.sender, lastUpdated);
    // Trigger an event
    emit VideoUploaded(doctor_count, _patient_hash, _doctor_name, _patient_name, _patient_gender, _prescription, msg.sender, lastUpdated);
  }
}
